) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: leave_category
#

DROP TABLE IF EXISTS `leave_category`;

CREATE TABLE `leave_category` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
