) ENGINE=InnoDB AUTO_INCREMENT=739 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: mark
#

DROP TABLE IF EXISTS `mark`;

CREATE TABLE `mark` (
  `mark_id` int(11) NOT NULL AUTO_INCREMENT,
