) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=latin1 COMMENT='holds records of last reference as consumed in paystack';



#
# TABLE STRUCTURE FOR: payable_types
#

DROP TABLE IF EXISTS `payable_types`;

CREATE TABLE `payable_types` (
  `payable_id` int(11) NOT NULL AUTO_INCREMENT,
  `payable_name` longtext NOT NULL,
  PRIMARY KEY (`payable_id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=latin1;



#
# TABLE STRUCTURE FOR: payment
#

DROP TABLE IF EXISTS `payment`;

CREATE TABLE `payment` (
